full_reasoning:
Let me think through this step by step...

We need a model that predicts the utility of accepting an offer for a responder.  Previous models focused on a fairness-based approach, comparing the received share to a perceived "fair" share based on token contributions.  However, we can explore alternative or additional mechanisms.  One such mechanism is **inequity aversion**. Inequity aversion suggests individuals experience disutility from both advantageous and disadvantageous inequality.  This means that responders may reject offers that are perceived as too unequal, regardless of whether the inequality favors them or the proposer.

We can combine this with a simple self-interest component.  A responder's utility will depend both on their monetary gain (self-interest) and the level of inequity in the split. We can model inequity using the absolute difference between the percentage shares, rather than just the responder's share.

We can then incorporate two learnable parameters: one reflecting the weight given to self-interest and the other representing the sensitivity to inequity.  This allows us to test whether both self-interest and inequity aversion significantly influence acceptance decisions. Keeping to the requirement of only two learnable parameters, we won't separate advantageous and disadvantageous inequality.


**Mathematical Form:**

The utility of accepting an offer can be expressed as a weighted sum of self-interest and inequity aversion.  The inequity term will be the absolute difference between the percentage shares, penalized for unequal contributions in tokens.  We can use the ratio of self and opponent tokens as a measure of relative contribution and then compare that to the ratio of percentage shares.  

**Parameters:**

Two learnable parameters will be sufficient: one for self-interest weighting (alpha) and one for inequity aversion weighting (gamma).


**Mapping to Observable Behavior:**

High values of `alpha` indicate strong self-interest.  High values of `gamma` reflect strong aversion to inequity. The model will predict higher utilities for offers with higher monetary gains and smaller inequity differences.


<MODEL>
U_accept = alpha * split_self - gamma * abs(splitperc_self - splitperc_opp) * abs( (token_self / (token_self + token_opp)) - (splitperc_self / (splitperc_self + splitperc_opp)) )
</MODEL>

